INSERT INTO `vaccini` (`CodiceVaccino`, `Nome`, `Tipologia`, `NumeroDosi`, `Info`, `Giorni`) VALUES
(1, 'Vaxzevria', 'Vettore Virale', 2, 'Il vaccino Vaxzevria (ex Astrazeneca) prevede 2 dosi di vaccino che devono essere somministrate almeno a 4 settimane di distanza. E\' un virus a vettore virale, ciò significa che viene iniettato nel corpo un virus modificato in laboratorio ed inattivo. In particolar modo viene iniettato nel corpo un virus tipico degli scimpanzé che porta alle cellule immunitarie del nostro corpo l\'informazione necessaria per proteggersi dalla proteina (SPIKE) usata dal Sars-Cov-2 per infettare l\'uomo. Il vaccino ha un\'efficacia dell\' 82,4%', 28),
(2, 'Johnson&Johnson', 'Vettore Virale', 1, 'Il vaccino Johnson&Johnson prevede 1 singola dose di vaccino. E\' un virus a vettore virale, ciò significa che viene iniettato nel corpo un virus modificato in laboratorio ed inattivo. In particolar modo viene iniettato nel corpo un adenovirus tipico degli uomini (Ad26) che porta alle cellule immunitarie del nostro corpo l\'informazione necessaria per proteggersi dalla proteina (SPIKE) usata dal Sars-Cov-2 per infettare l\'uomo. Il vaccino ha un\'efficacia dell\' 85%', NULL),
(3, 'Pfizer', 'mRNA', 2, 'Il vaccino Pfizer prevede 2 dosi di vaccino che devono essere somministrate almeno a 3 settimane di distanza. E\' un virus a mRNA, ciò significa che viene iniettato nel corpo un RNA messaggero modificato in laboratorio. Questo RNA messaggero modificato trasporta alle cellule immunitario del nostro corpo le informazioni necessarie per sintetizzare la proteina (SPIKE) usata dal Sars-Cov-2 per infettare l\'uomo. Il vaccino ha un\'efficacia dell\' 95%', 21),
(4, 'Moderna', 'mRNA', 2, 'Il vaccino Moderna prevede 2 dosi di vaccino che devono essere somministrate almeno a 4 settimane di distanza. E\' un virus a mRNA, ciò significa che viene iniettato nel corpo un RNA messaggero modificato in laboratorio. Questo RNA messaggero modificato trasporta alle cellule immunitario del nostro corpo le informazioni necessarie per sintetizzare la proteina (SPIKE) usata dal Sars-Cov-2 per infettare l\'uomo. Il vaccino ha un\'efficacia dell\' 94,1%', 28);
